const  ImageLinkForm = () => {
    return (
        <div>
            <p className='fa3'>
                {'This Magic brain will detect faces in images! Give it a try!'}
            </p>
            <div>
                <input type='tex' />
                
            </div>
        </div>
    );
}
export default ImageLinkForm;
